import React from "react";

// Components :
import Table from "./Table";
import NavBar from "./NavBar";

function Dashboard() {
  // const columns = [
  //   { label: "Task", renderCell: (item) => item.name },
  //   {
  //     label: "Deadline",
  //     renderCell: (item) =>
  //       item.deadline.toLocaleDateString("en-US", {
  //         year: "numeric",
  //         month: "2-digit",
  //         day: "2-digit",
  //       }),
  //   },
  //   { label: "Type", renderCell: (item) => item.type },
  //   {
  //     label: "Complete",
  //     renderCell: (item) => item.isComplete.toString(),
  //   },
  //   { label: "Tasks", renderCell: (item) => item.nodes?.length },
  // ];

  const columns = [
    {
      name: <h1>S.No</h1>,
      width: "60px",
      cell: (row, index) => <div className="text-[#6D6D6D]">{index + 1}</div>,
    },
    {
      name: <h1>Date</h1>,
      width: "250px",
      cell: (row) => (
        <div>
          J:{row.createdAt} <br />
          L:{row.lastActive}
        </div>
      ),
      selector: (row) => row.createdAt,
      sortable: true,
    },
    {
      name: <h1>Auth</h1>,
      width: "250px",
      cell: (row) => (
        <div>
          {row.emailId} <br />
          {row.mobNo}
        </div>
      ),
      selector: (row) => row.mobNo,
      sortable: true,
    },
    {
      name: <h1>Wallet</h1>,
      width: "125px",
      cell: (row) => (
        <div>
          Coins : {row.coins} <br />
          Wallet : {row.wallet}
        </div>
      ),
      selector: (row) => row.wallet,
      sortable: true,
    },
    {
      name: <h1>Buds</h1>,
      width: "100px",
      cell: (row) => <div>{row.budsCount}</div>,
      selector: (row) => row.budsCount,
      sortable: true,
    },
    {
      name: <h1>Followers</h1>,
      width: "100px",
      cell: (row) => <div>{row.followersCount}</div>,
      selector: (row) => row.followersCount,
      sortable: true,
    },
    {
      name: <h1>Status</h1>,
      // width: "100px",
      cell: (row) => <div>{row.buddyStatus}</div>,
      selector: (row) => row.buddyStatus,
      sortable: true,
    },
    // {
    //   name: <h1>Action</h1>,
    //   width: "150px",
    //   cell: (row) => (
    //     <div
    //       className="flex flex-row bg-[#E8E8EE] px-6 py-2 rounded-[3px]"
    //       // onClick={() => {
    //       //   setEditPopup(!editPopup);
    //       // }}
    //     >
    //       Edit
    //       <img
    //         src={Edit_Arrow}
    //         alt=""
    //         className="w-[14px] h-[14px] self-center ml-1"
    //       />
    //     </div>
    //   ),
    // },
  ];

  return (
    <div>
      <div className="flex flex-col">
        <NavBar />
        <Table columnsHeading={columns} />
      </div>
    </div>
  );
}

export default Dashboard;
